import Nav from "react-bootstrap/Nav";
import NavDropdown from 'react-bootstrap/NavDropdown';

const NavItem = ({ data }) => (
  <Nav.Link>
    {data.color ? 
      <span style={{"color": data.color}}>{data.title}</span>
    : data.title}
  </Nav.Link>
)

export default NavItem
